		<style>
			:root {
				--color-segment-payroll: #72cfe9;
			}

			.the-whole-enchilada {
				isolation: isolate;
			}

			.soar-accronym {
				fill: var(--wp--preset--color--brand-red);
			}

			.ring-text {
				fill: #fff;
			}

			.ring-text,
			.soar-accronym {
				filter: url(#drop-shadow-1);
			}

			.ring-segment-ppd,
			.icon-ppd .inner-icon {
				fill: var(--wp--preset--color--brand-gray);
			}

			.ring-segment-cyber,
			.icon-cyber .inner-icon {
				fill: var(--wp--preset--color--brand-gray-dark);
			}

			.ring-segment-payroll,
			.icon-payroll .inner-icon {
				fill: var(--color-segment-payroll);
			}

			.ring-segment-ffvs,
			.icon-ffvs .inner-icon {
				fill: var(--wp--preset--color--brand-blue);
			}

			.ring-segment-oaas,
			.icon-oaas .inner-icon {
				fill: var(--wp--preset--color--brand-red);
			}

			.icon-ppd circle,
			.icon-cyber circle,
			.icon-payroll circle,
			.icon-ffvs circle,
			.icon-oaas circle {
				fill: white;
			}

			.full-name {
				fill: #262626;
			}

			.mark-registered {
				fill: #262626;
				font-family: MyriadPro-Regular, "Myriad Pro", serif;
				font-size: 15px;
			}

			@media (prefers-color-scheme: dark) {
				.full-name {
					fill: #d4d4d4;
				}

				.mark-registered {
					fill: #a3a3a3;
				}
			}
